import React from 'react';

import { Col, Panel, Label } from 'react-bootstrap';
import {CryptocurrencyCard} from 'react-ui-cards'

const card = (props) => {
    return (
        <Col xs={12} sm={3}>
            <Panel>
                <Panel.Heading >
                    <Panel.Title componentClass="h3">
                        {props.title}
                    </Panel.Title>
                </Panel.Heading>
                <Panel.Body>
                    <h3><Label>Sales</Label></h3>
                    {props.body}
                </Panel.Body>
            </Panel>
        </Col>
    )
};

export default card;
